import React, { Component } from 'react';
import LoanLogo from '../assets/svg/money-loan-logo.svg';

class LoanForm extends Component {
    constructor() {
        super();
        this.state = {
            firstName: "",
            firstNameError: "",
            lastName: "",
            lastNameError: "",
            username: "",
            usernameError: "",
            email: "",
            emailError: "",
            password: "",
            passwordError: ""
          };
      } 
    render() {
      return (
        <div className='loan-form'>
            <img
            className='loan-logo-icon'
            width='35px'
            height='35px'
            alt='loan logo icon'
            src={LoanLogo}
            />
        </div>
      );
    }
  }
  
  export default LoanForm;
